feature.position
feature.on('click',e=>{

let animation1 = feature.createAnimation('position')

animation1.setKeys([{
  frame: 150, // standard is 30 fps (means it take 1 second)
  value: feature.position.add( new Vector3(0,0,1) )
}])

feature.startAnimations( [animation1] ) //Starts the animation


let numMilliseconds = 10000 //one seconds
setInterval(()=>{



let animation2 = feature.createAnimation('position')

animation2.setKeys([{
  frame: 30, // standard is 30 fps (means it take 1 second)
  value: feature.position.add( new Vector3(0,0,-0,5) )
}])

feature.startAnimations( [animation2] ) //Starts the animation
},numMilliseconds)
})

